import React from "react";
import '../css/section5.css'

class Section5 extends React.Component{
    render(){
        return(
            <section className="Section5">
                <article className="Section5-title">
                    <h1>Выбирайте комфортный формат обучения</h1>
                    <p className="Section5-info">Занятия проходят в онлайн формате в группах или индивидуально. Обратная связь от преподавателя в режиме реального времени. </p>
                </article>

                <article className="Section5-lessons">
                    <div className="Section5-individual_lessons Section5-block">
                        <h2>Индивидуальные уроки</h2>
                    </div>

                    <div className="Section5-group_lessons Section5-block">
                        <h2></h2>
                    </div>
                </article>
            </section>
        )
    }
}
